import React from 'react';

const Welcome =
    <div className="Welcome-Message">
        <h1 className="Section-Header">Make money online with matched betting</h1>
        <p className="Welcome-Text">Bookmakers give away a lot of cash in order to attract new customers and to keep existing ones. Matched betting is a way to exploit their offers and cash out these bonuses. This site offers you tools to make your matched betting job easier. And it is free of charge.</p>
        <a href="/" className="Button">Learn more</a>
    </div>;

export default Welcome;
